import React from "react";

const Contact = () => {
  return (
    <div class="contact-card">
    <h2>Наши контакты</h2>
    <div class="contact-entry">
      <span>bondarenkodanil.0604@gmail.com</span>
      <span>+77084181394</span>
    </div>

    <div class="label">Тех поддержка</div>
    <div class="contact-entry">
      <span>bondarenkodanil.0604@gmail.com</span>
      <span>+77084181394</span>
    </div>

    <div class="label">Устроиться на работу</div>
    <div class="contact-entry">
      <span>bondarenkodanil.0604@gmail.com</span>
      <span>+77084181394</span>
    </div>
  </div>
  );
};

export default Contact;
